description:
Synopsis:
Nami creates a plan for the Straw Hats to rescue Lily's father, Panz Fry. Chopper, Robin, Brook, and Luffy are the diversion group while Usopp, Sanji, Zoro, and Lily are in the submarine. Luffy goes on the submarine because he finds the diversion group boring. They rescue Panz Fry, but Momonga attacks Luffy, forcing Zoro to intercept him.

Shuzo attacks the marines and Panz Fry. His pet alpaca Alpacacino shoots out a cannon at the Marine ships. Shuzo attacks Panz Fry directly but is intercepted by Luffy. Shuzo then kicks Luffy into the sea. Zoro jumps into the water to save his captain, and Shuzo and Sanji get into an argument. Shuzo tells Momomga his reason why he quit the marines, much to the dismay of the rest of his crew. Luffy and Zoro then resurface and Luffy threatens Shuzo. Luffy and Momonga prepare to fight Shuzo.

Video: H264 - MPEG-4 AVC, 23fps
Quality: 480p (853x480)

Audio: Vorbis Audio 44kHz
Language: Japanese
Subtitles: English

